class FABSUser:
    def __init__(self, name):
        self.name = name

    def submit_fabs(self, file):
        # Validate file format and content
        if not self.validate_file(file):
            raise ValueError("Invalid file format or content")

        # Process file and save to database
        self.process_file(file)

    def validate_file(self, file):
        # Check file extension
        if not file.endswith(".csv"):
            return False

        # Check for required columns
        required_columns = ["column1", "column2", "column3"]
        with open(file, 'r') as f:
            header = f.readline().strip().split(',')
            for column in required_columns:
                if column not in header:
                    return False

        return True

    def process_file(self, file):
        # Read file and extract data
        data = []
        with open(file, 'r') as f:
            next(f)  # Skip header
            for line in f:
                data.append(line.strip().split(','))

        # Save data to database
        # For simplicity, assume we have a function to save data to database
        self.save_to_database(data)

    def save_to_database(self, data):
        # Simulate saving data to database
        logging.info("Saving data to database...")
        for row in data:
            logging.info(f"Saving row: {row}")

